import React from 'react';

// JSX Components
import Header from './Header';
import Footer from './Footer';

function App() {
  return (
    <div>
      <Header />
      <img src="https://cdn.shopify.com/s/files/1/0057/3728/3618/products/braveheart_480x.progressive.jpg?v=1625084571" alt="Braveheart" width="175" height="250"></img>
      <Footer />
    </div>
  );
}

export default App;
